<script type="text/javascript">
googletag.cmd.push(function() {
      googletag.pubads().enableAsyncRendering();
        googletag.pubads().enableSingleRequest();
          googletag.pubads().disableInitialLoad();
      //Pulling the ad sizes from URL for testing the ad sizes
  function test_check(){
    if (window.location.href.indexOf("test") >= 0) {
      var vars = window.location.href.split('?');
      for (i in vars){
        if (vars[i].indexOf("test") >= 0){
          return [vars[i].split('=')[1]]
        }
      }}
    return [""]
  }
  function setCookie(name, value, days) {
    const d = new Date();
    d.setTime(d.getTime() + 24 * 60 * 60 * 1000 * days);
    // eslint-disable-next-line prefer-template
    document.cookie = name + '=' + value + ';path=/;expires=' + d.toGMTString() + ';domain=.nasdaq.com';
  }
  function initRecentlyViewedTracking() {
    // Get recently viewed cookie and populate data variables
    var recentlyViewedCookie = getCookie('recentlyViewedList');
    if (recentlyViewedCookie && recentlyViewedCookie !== 'false') {
      var recentlyViewedCookieArray = recentlyViewedCookie.split(',').reverse();
      return recentlyViewedCookieArray;
    }
    else {
      return '';
    }
  }
  function initVolatilityTracking() {
    var volatileCookie = getCookie('volatileMarket');
    if (!volatileCookie) {
      var api;
      if (window.location.hostname.split(".")[0] === 'www') {
        var api = 'api';
      } else {
        var api = 'qcapi';
      }
      Promise.all([
        fetch('https://' + api + '.nasdaq.com/api/quote/indices?symbol=indu&symbol=ndx&symbol=comp&symbol=rut&symbol=spx')
      ]).then(function (responses) {
        // Get a JSON object from each of the responses
        return Promise.all(responses.map(function (response) {
          return response.json();
        }));
      }).then(function (data) {
        // Grab percentage change from each index
        var indu = parseFloat(data[0].data[0].percentageChange);
        var comp = parseFloat(data[0].data[1].percentageChange);
        var ndx = parseFloat(data[0].data[2].percentageChange);
        var rut = parseFloat(data[0].data[3].percentageChange);
        var spx = parseFloat(data[0].data[4].percentageChange);
        var percentArray = [indu, comp, ndx, rut, spx];
        // Check if any are up/down more than 0.5%, if so then set the cookie and set ad targeting
        var volatileIndex = percentArray.filter(elem => {
          return elem > 0.5 || elem < -0.5;
        });
        if (volatileIndex.length != 0) {
          setCookie('volatileMarket', true, 1);
          return 'true';
        }
      }).catch(function (error) {
        // console.error('Error in initVolatilityTracking:', error);
        return 'false';
      });
    } else {
      // Already a violatile market so just set ad targeting
      return 'true';
    }
  }
  function userAgentCheck() {
    var userAgent = "Internal";
    console.log(navigator.userAgent);
    if (navigator.userAgent.indexOf("Chrome-Lighthouse") > 0 || navigator.userAgent.indexOf("New Relic") > 0) {
      userAgent = "External";
    }
    return userAgent;
  }
  setTimeout(function () {
    if (typeof drupalSettings != "undefined") {
      // Set variable if Nasdaq Plus user
      if (drupalSettings.user_info.user_nasdaq_plus === true) {
        googletag.pubads().setTargeting("nplus", 'Yes');
      }
      else {
        googletag.pubads().setTargeting("nplus", 'No');
      }

      // If consent and logged in user, set DFP targeting
      if (consentCookie && consentCookie.includes('C0004%3A1') && drupalSettings.user_info.loggedIn === true) {
        var uid = drupalSettings.user.uid;
        var watchlist_symbols = {
            "async": false,
            "crossDomain": true,
            "url": "/api/v1/watchlist/" + uid,
            "method": "GET",
            "headers": {
            "content-Type" : "application/x-www-form-urlencoded",
          }
        }
        // Pass Watchlist Symbols and Any Tipranks portfolio info
        window.jQuery.ajax(watchlist_symbols).then(function(responseText) {
          googletag.pubads().setTargeting("nasdaqdotcom_watchlist_symbol_list", responseText.watchlist);
        });
        var portfolioProfessionCookie = getCookie('portfolioProfession');
        var portfolioAnnualIncomeCookie = getCookie('portfolioAnnualIncome');
        var portfolioAgeCookie = getCookie('portfolioAge');
        if (portfolioProfessionCookie) {
          googletag.pubads().setTargeting("nasdaqdotcom_portfolio_profession", portfolioProfessionCookie);
        }
        if (portfolioAnnualIncomeCookie) {
          googletag.pubads().setTargeting("nasdaqdotcom_portfolio_annual_income", portfolioAnnualIncomeCookie);
        }
        if (portfolioAgeCookie) {
          googletag.pubads().setTargeting("nasdaqdotcom_portfolio_age", portfolioAgeCookie);
        }
      }
    }
  }, 2000);
  googletag.pubads().setTargeting("nasdaqdotcom_page_instance_id", digitalData.pageInstanceID || '');
  googletag.pubads().setTargeting("nasdaqdotcom_page_template", digitalData.page.category.pageType || '');
  googletag.pubads().setTargeting("nasdaqdotcom_publisher", digitalData.page.pageInfo.publisher || '');
  googletag.pubads().setTargeting("nasdaqdotcom_page_name", digitalData.page.pageInfo.pageName || '');
  googletag.pubads().setTargeting("nasdaqdotcom_search_term", digitalData.page.pageInfo.onsiteSearchTerm || '');
  googletag.pubads().setTargeting("nasdaqdotcom_region_tag_list", (digitalData.page.attributes.region || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_topic_tag_list", (digitalData.page.attributes.topic || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_asset_class_tag_list", (digitalData.page.attributes.assetClass || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_quote_symbol_list", (digitalData.page.attributes.quoteSymbol || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_industry_tag_list", (digitalData.page.attributes.industry || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_audience_tag_lists", (digitalData.page.attributes.audience || []).join(","));
  googletag.pubads().setTargeting("nasdaqdotcom_recently_viewed_symbol_list", initRecentlyViewedTracking());
  googletag.pubads().setTargeting("nasdaqdotcom_volatile_market", initVolatilityTracking() || 'false');
  googletag.pubads().setTargeting("nasdaqdotcom_video_type", digitalData.page.category.videoType || '');
  googletag.pubads().setTargeting("nasdaqdotcom_event_type", digitalData.page.category.eventType || '');
  googletag.pubads().setTargeting("nasdaqdotcom_user_agent", userAgentCheck());
  googletag.pubads().setTargeting("test",test_check());

  googletag.enableServices();
});
